function App() {
  return (
    <Router>
      <div>
        <Header />
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/workouts" component={Workouts} />
          <Route path="/blog" component={Blog} />
          {/* Add routes for other pages */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;



